// components/Home.js
import React from "react";
import pets from "../pets.png";

const Home = () => {
  return (
    <div>
      <h1>Welcome to our Pet Store!</h1>
      <img
        src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pinterest.com%2Fpin%2Fborder-png-cute-pet-illustrations-on-transparent-background--776096948288717376%2F&psig=AOvVaw0t3SEKbD8JE2e0o8spWzgH&ust=1710365304570000&source=images&cd=vfe&opi=89978449&ved=0CBMQjRxqFwoTCMCn-LTV74QDFQAAAAAdAAAAABAS"
        alt="Pet Store"
      />
    </div>
  );
};

export default Home;
